import React from "react";
import "./home.css";

function Home() {
  const navbar = document.getElementById("head-container");

  window.addEventListener("scroll", () => {
    let val = window.scrollY;
  });

  return (
    <div>
      <header className="head-container">
        <div className="nav-box">
          <nav className="nav-left">
            <a href="#" className="logo">
              Shubham
            </a>
          </nav>
          <nav className="nav-right">
            <a href="#">Home</a>
            <a href="#">Project</a>
            <a href="#">About Me</a>
            <a href="#">Contacts</a>
          </nav>
        </div>
      </header>
    </div>
  );
}

export default Home;
